import React,{useState} from 'react';
import { makeStyles } from '@material-ui/core/styles';
import {Toolbar,IconButton,Typography,InputBase,Badge,ButtonBase,Box,Divider, Grid,} from '@material-ui/core';
import p1 from '../image/p1.jpg';


const useStyles = makeStyles((theme) => ({
  grow: {
    flexGrow: 1,
  },
  ban1: {
      width: "100%",
      height: "600px",
  }
}));


export default function View() {
  const classes = useStyles();
  
  return (
      <React.Fragment>
    <div className={classes.grow}>
    <Grid container spacing={2} style={{width:"80%",marginLeft:"10%"}}>
        <Grid item xs={6}>
            <img src={p1} className={classes.ban1}  />
        </Grid>
        <Grid item xs={4}>
            <Typography >
                <Box fontSize={30} >Fortune Soya Health Refined Soyabean Oil (Pouch)</Box>
            </Typography>
        </Grid>
    </Grid>
    </div>
    </React.Fragment>
  );
}
